import React, {useEffect} from 'react';

import Aos from 'aos'
import 'aos/dist/aos.css';
const Temoignage = () => {
    useEffect(() => {
        Aos.init({duration:3000})
    })
    return (
        <div data-aos="fade-up">
            <h1>Temoignage</h1>
        </div>
    );
};

export default Temoignage;
